butes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 1.62 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 0 &lt;/li&gt;\n         \n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://131.225.189.79:10066 &lt;/li&gt;\n          &lt;li&gt; Workers: 1 &lt;/li&gt;\n          &lt;li&gt; Threads: 1 &lt;/li&gt;\n          &lt;li&gt; Memory: 3.73 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2022.02.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2022.2.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport os, sys\nimport subprocess\nimport json\nimport uproot\nimport awkward as ak\n\nfrom coffea import processor, util, hist\nfrom coffea.nanoevents import NanoEventsFactory, NanoAODSchema\nfrom boostedhiggs import VBFProcessor\nfrom boostedhiggs import DDTProcessor\n\nfrom distributed import Client\nfrom lpcjobqueue import LPCCondorCluster\n\nfrom dask.distributed import performance_report\nfrom dask_jobqueue import HTCondorCluster, SLURMCluster\n\nenv_extra = [\n    f\"export PYTHONPATH=$PYTHONPATH:{os.getcwd()}\",\n]\n\ncluster = LPCCondorCluster(\n    transfer_input_files=[\"boostedhiggs\"],\n    ship_env=True,\n    memory=\"4GB\",\n#    image=\"coffeateam/coffea-dask:0.7.11-fastjet-3.3.4.0rc9-ga05a1f8\",\n)\n\ncluster.adapt(minimum=1, maximum=50)\nclient = Client(cluster)\n\nprint(\"Waiting for at least one worker...\")  # noqa\nclient.wait_for_workers(1)\n\nyear = sys.argv[1]\n\nwith performance_report(filename=\"dask-report.html\"):\n\n    # get list of input files                                                                                                 \n    infiles = subprocess.getoutput(\"ls infiles/\"+year+\"*QCD*.json\").split()\n\n    for this_file in infiles:\n\n        index = this_file.split(\"_\")[1].split(\".json\")[0]\n\n        print(this_file, index)\n\n        uproot.open.defaults[\"xrootd_handler\"] = uproot.source.xrootd.MultithreadedXRootDSource\n\n        p = DDTProcessor(year=year,jet_arbitration='ddb',systematics=False)\n        args = {'savemetrics':True, 'schema':NanoAODSchema}\n\n        output = processor.run_uproot_job(\n            this_file,\n            treename=\"Events\",\n            processor_instance=p,\n            executor=processor.dask_executor,\n            executor_args={\n                \"client\": client,\n                \"skipbadfiles\": 1,\n                \"schema\": processor.NanoAODSchema,\n                \"treereduction\": 2,\n            },\n            chunksize=100000,\n            #        maxchunks=args.max,\n        )\n\n        outfile = 'outfiles/ddt_'+str(year)+'_dask_'+index+'.coffea'\n        util.save(output, outfile)\n        print(\"saved \" + outfile)\n\n\n        &lt;/pre&gt;\n        "},"id":"1387","type":"Div"},{"attributes":{},"id":"1452","type":"DatetimeTickFormatter"},{"attributes":{},"id":"1465","type":"Selection"},{"attributes":{"active_drag":"auto","active_inspect":"auto","active_multi":null,"active_scroll":"auto","active_tap":"auto","tools":[{"id":"1373"},{"id":"1374"},{"id":"1375"}]},"id":"1376","type":"Toolbar"},{"attributes":{},"id":"1466","type":"UnionRenderers"},{"attributes":{"bottom":{"field":"bottom"},"fill_color":{"field":"color"},"left":{"field":"left"},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1065","type":"Quad"},{"attributes":{"source":{"id":"1208"}},"id":"1384","type":"CDSView"},{"attributes":{},"id":"1473","type":"Selection"},{"attributes
